  getrandomPcUA() {
    let uas = this.useAgents.pc;
    let broType = this.utils.randomNum(0, 3);
    let bro;
    switch (broType) {
      case 0:
        bro = this.uas.ie;
        break;
      case 1:
        bro = this.uas.firefox;
        break;
      case 2:
        bro = this.uas.safari;
        break;
      case 3:
        bro = this.uas.chrome;
        break;
    }
    return bro[this.utils.randomNum(0, bro.length - 1)];
  }

  getrandomMobileUA() {
    let broType = this.utils.randomNum(0, 3);
    let bro = this.userAgents.mobile;
    return bro[this.utils.randomNum(0, bro.length - 1)];
  }
